import './App.css';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router,Switch,Route } from 'react-router-dom';

function App() {
  return (

    <div className="App">
      <Router>
        <Switch>
          <Route path="/checkout">   

            <h1>I am a checkout,Smash the Like Button</h1>

          </Route>

          <Route path="/">   
            <Header/>
            <Home/>
          </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
